import React from "react"
import { Link } from "react-router-dom"


export default function SoupList(props) {
    // render
    const renderSoup = () => {
      if (!props.soups)
        return null

      return props.soups.map((soups, index) => {
        return (
          <div key={index}>
            <p><Link to={`${soups.id}/`}>{ soups.title }</Link></p>
            <p>{ soups.description }</p>
            <p>{ soups.ingredients }</p>
            <p>{ soups.instructions }</p>
          </div>
        )
      })
    }

    return (
      <div>
          <div>
              <p>#</p>
              <p>Soup: {props.soups.title}</p>
              <p>description {props.soups.description}</p>
              <p>ingredients {props.soups.ingredients}</p>
              <p>instructions {props.soups.ingredients}</p>
          </div>
          <div>
            { renderSoup() }
          </div>
      </div>
    )
  }
